import ChatBotButton from '../ChatBotButton';  // Import the ChatBotButton

const Home = () => {
  return (
    <>
      <ImageSlider slides={SliderData} />

      <div className="slider-text">
        <h1>RentTheTrend</h1>
        <h6>Clothes for all</h6>
        <Link to="/register" className="get-started-button">Get started â†’</Link>
      </div>

      <Footer />

      {/* Render the ChatBotButton at the bottom-right corner */}
      <div style={{
        position: 'fixed',
        bottom: '20px',
        right: '20px',
        zIndex: '1000',  // Ensure it stays above other elements
      }}>
        <ChatBotButton />
      </div>
    </>
  );
}

export default Home;
